function App() {
  const [name,setName]=useState("")
  const [newItem,setNewItem]=useState([])


  const addItem=()=>{
    setNewItem((newOne)=>[...newOne,name])
    console.log(name)
  }

  return (
    <div>
        <input type="text" value={name} onChange={(e)=>setName(e.target.value)}/>
        <button onClick={addItem}>Add</button>


        {}
    </div>
  )
}

export default App
